import {useEffect, useState} from 'react';
import axios from 'axios';
import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';

const useStyles = makeStyles({
    table: {
        minWidth: 650,
    },
});

export default function AdminDashboard(props) {
    const [tutorsApplications, setTutorsApplications] = useState([]);
    const {setDisplayNavbar, setUser} = props;
    setDisplayNavbar(true);
    useEffect(() => {
        const ac = new AbortController();
        axios.get('/auth/isLoggedIn')
            .then(res => res.data)
            .catch(err => console.log(err))
            .then(res => {
                if (res.isLoggedIn) {
                    const user = res.user;
                    setUser(user);
                    axios.get('/admin/tutorsApplications')
                        .then(res => res.data)
                        .catch(err => console.log(err))
                        .then(res => {
                            if (res.success) {
                                setTutorsApplications(res.result);
                            } else {
                                alert("Failed to get tutors applications");
                            }
                        })
                } else {
                    window.open('/', '_self');
                }
            })
        return () => {
            ac.abort();
        }
    }, [setUser]);
    return <div className="wrapper">
        <div className="sidebar">
            <h2>Admin</h2>
            <ul>
                <li>Tutors applications</li>
                <li>Existing subjects</li>
                <li>Existing tutors</li>
                <li>Add new admin</li>
                <li>Delete user account</li>
                <li>Report bugs</li>
            </ul>
        </div>
        <div className="content">
            <div className="box">
                <div className="box_top">
                    <h2>Tutors Applications</h2>
                </div>
                <div className="box_bottom">
                    fsdfsdf
                </div>
            </div>
        </div>
    </div>
}
